}]

function List() {
    const listItem = () => {
        return (
            <div>
                <label class="container">One
                    <input type="radio" checked="checked" name="radio" />
                    <span class="checkmark"></span>
                </label>
            </div>
        )
    }

    return (
        <div css={listContainer}>
            <h1>To-do list</h1>
            {listItem()}
        </div>
    )
}

export default List;
